const appThemeColor = '#fecd3b';
const fontColor = '#333333';
const borderColor = '#f6f7f8';
const formBackground = '#f2f2f2';
const formFontGray = '#888888';
const fontColorGray = '#b2b2b2';
const fontColorLink = '#586a92';

const style = {
    bottomDivider: {
        clear: 'both',
        padding: '3px 0',
        backgroundColor: borderColor,
        display: 'block'
    }
};

export default {
    appThemeColor,
    fontColor,
    borderColor,
    formBackground,
    fontColorGray,
    fontColorLink,
    formFontGray,
    style
};
